import assert from 'node:assert/strict';

const CHAR_CODE_A = 'a'.charCodeAt(0);

const N = 1000000;

let a: number[] = [];

const t = Array(N)
    .fill(null)
    .map(() => Array(28).fill(-1)) as number[][];
const l = Array(N) as number[];
const r = Array(N) as number[];
const p = Array(N) as number[];
const s = Array(N) as number[];
let tv = 0;
let tp = 0;
let ts = 0;
let la = 0;

// First: When the app starts, immediately create the strign and pass it to the JSI, and build suffix tree
// Only partial updates- send update to native module, run ukkadd for every character

function ukkadd(c: number) {
    while (true) {
        if (r[tv] < tp) {
            if (t[tv][c] == -1) {
                t[tv][c] = ts;
                l[ts] = la;
                p[ts++] = tv;
                tv = s[tv];
                tp = r[tv] + 1;
                continue;
            }
            tv = t[tv][c];
            tp = l[tv];
        }
        if (tp == -1 || c == a[tp]) {
            tp++;
        } // if the letter on the edge equal c, go down that edge
        else {
            // otherwise split the edge in two with middle in node ts
            l[ts] = l[tv];
            r[ts] = tp - 1;
            p[ts] = p[tv];
            assert(t[ts] != null, `t[ts] is null. ts is ${ts}`);
            t[ts][a[tp]] = tv;
            // add leaf ts+1. It corresponds to transition through c.
            t[ts][c] = ts + 1;
            l[ts + 1] = la;
            p[ts + 1] = ts;
            // update info for the current node - remember to mark ts as parent of tv
            l[tv] = tp;
            p[tv] = ts;
            t[p[ts]][a[l[ts]]] = ts;
            ts += 2;
            // prepare for descent
            // tp will mark where are we in the current suffix
            tv = s[p[ts - 2]];
            tp = l[ts - 2];
            // while the current suffix is not over, descend
            while (tp <= r[ts - 2]) {
                tv = t[tv][a[tp]];
                tp += r[tv] - l[tv] + 1;
            }
            // if we're in a node, add a suffix link to it, otherwise add the link to ts
            // (we'll create ts on next iteration).
            if (tp == r[ts - 2] + 1) {
                s[ts - 2] = tv;
            } else {
                s[ts - 2] = ts;
            }
            // add tp to the new edge and return to add letter to suffix
            tp = r[tv] - (tp - r[ts - 2]) + 2;
            continue;
        }

        break;
    }
}

function build() {
    ts = 2;
    tv = 0;
    tp = 0;
    r.fill(a.length - 1);
    s[0] = 1;
    l[0] = -1;
    r[0] = -1;
    l[1] = -1;
    r[1] = -1;
    t[1].fill(0);

    for (la = 0; la < a.length; ++la) {
        ukkadd(a[la]);
    }
}

function stringToArray(input: string) {
    const res: number[] = [];
    for (let i = 0; i < input.length; i++) {
        res.push(Math.min(Math.max(input.charCodeAt(i) - CHAR_CODE_A, 0), 27));
    }
    return res;
}

function findSubstring(sString: string) {
    const s = stringToArray(sString);
    const occurrences: number[] = [];
    const st: Array<[number, number]> = [[0, 0]];

    while (st.length > 0) {
        const [node, depth] = st.pop()!;

        let isLeaf = true;
        const leftRange = l[node];
        const rightRange = r[node];
        const rangeLen = node === 0 ? 0 : rightRange - leftRange + 1;

        let matches = true;
        for (let i = depth; i < depth + rangeLen && i < s.length; ++i) {
            if (s[i] != a[i - depth + leftRange]) {
                matches = false;
                break;
            }
        }

        if (!matches) {
            continue;
        }

        for (let i = 27; i >= 0; --i) {
            if (t[node][i] != -1) {
                isLeaf = false;
                const nextDepth = depth + rangeLen;
                st.push([t[node][i], nextDepth]);
            }
        }

        // If it's a leaf node and we've matched the full substring
        if (isLeaf && depth + rangeLen >= s.length) {
            // cout << "Found at " << a.size() - (depth + rangeLen) << "depth: " << depth << "range: " << rangeLen << endl;
            occurrences.push(a.length - (depth + rangeLen));
        }
    }

    return occurrences;
}

